import React from 'react';
import {NavLink} from 'react-router-dom'
import '../../css/styles.css';



const LoginLinks = () => {

	return(
		<a class="nav-link" href="./components/auth/Signin.js">
          <button type="button" class="btn btn-info btn-primary  btn-sm my-0 "><NavLink to='./components/auth/Signin'>Login</NavLink></button>
          

        </a>



	)
}

export default LoginLinks
